// src/components/Register.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';
import axios from 'axios';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000/api';

const Register = () => {
  const [formData, setFormData] = useState({
    client_id: '',
    api_key: '',
    userid: '',
    two_fa: '',
    vendor_info: ''
  });
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Basic validation
    for (const [key, value] of Object.entries(formData)) {
      if (!value.trim()) {
        toast.error(`${key.replace('_', ' ')} is required`);
        return;
      }
    }

    setLoading(true);

    try {
      const response = await axios.post(
        `${API_URL}/register`, 
        formData
      );

      toast.success('Registration successful! You can now login.');
      navigate('/login');
    } catch (error) {
      const message = error.response?.data?.message || 'Registration failed. Please try again.';
      toast.error(message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="row justify-content-center">
      <div className="col-md-8">
        <div className="card">
          <div className="card-header">
            <h4 className="text-center">Client Registration</h4>
          </div>
          <div className="card-body">
            <form onSubmit={handleSubmit}>
              <div className="mb-3">
                <label htmlFor="client_id" className="form-label">
                  Client ID
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="client_id"
                  name="client_id"
                  value={formData.client_id}
                  onChange={handleChange}
                  required
                />
              </div>

              <div className="mb-3">
                <label htmlFor="api_key" className="form-label">
                  API Key
                </label>
                <input
                  type="password"
                  className="form-control"
                  id="api_key"
                  name="api_key"
                  value={formData.api_key}
                  onChange={handleChange}
                  required
                />
              </div>

              <div className="mb-3">
                <label htmlFor="userid" className="form-label">
                  User ID
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="userid"
                  name="userid"
                  value={formData.userid}
                  onChange={handleChange}
                  required
                />
              </div>

              <div className="mb-3">
                <label htmlFor="two_fa" className="form-label">
                  Two-Factor Authentication Code
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="two_fa"
                  name="two_fa"
                  value={formData.two_fa}
                  onChange={handleChange}
                  required
                />
              </div>

              <div className="mb-3">
                <label htmlFor="vendor_info" className="form-label">
                  Vendor Info
                </label>
                <input
                  type="text"
                  className="form-control"
                  id="vendor_info"
                  name="vendor_info"
                  value={formData.vendor_info}
                  onChange={handleChange}
                  required
                />
              </div>

              <div className="d-grid gap-2">
                <button
                  type="submit"
                  className="btn btn-primary"
                  disabled={loading}
                >
                  {loading ? (
                    <span>
                      <span className="spinner-border spinner-border-sm me-2" />
                      Registering...
                    </span>
                  ) : (
                    'Register'
                  )}
                </button>
              </div>
            </form>
            <div className="mt-3 text-center">
              <p>
                Already have an account?{' '}
                <a href="/login">Login here</a>
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
